extends Node3D

func lucky_mesaji_goster():
	var mesaj_label = get_node_or_null("UI/LuckyMesajLabel")
	print("Mesaj label bulundu mu? ", mesaj_label)
	if mesaj_label:
		mesaj_label.text = "Lucky seni kurtardı!"
		mesaj_label.visible = true
		await get_tree().create_timer(2.5).timeout
		mesaj_label.visible = false

func lucky_panel_goster():
	var panel = get_node_or_null("UI/LuckyMesajPanel")
	if panel:
		panel.visible = true
		await get_tree().create_timer(2.5).timeout
		panel.visible = false

func ceteci_yakaladi():
	print("Mete çeteciye yakalandı! %30 malzeme kaybı.")
	var panel = get_node_or_null("UI/LuckyMesajPanel")
	var label = get_node_or_null("UI/LuckyMesajLabel")
	if panel and label:
		panel.visible = true
		label.text = "Çeteci seni yakaladı!"

func ceteciden_kurtul():
	print("Mete kurtuldu! Ödül veriliyor.")
	var panel = get_node_or_null("UI/LuckyMesajPanel")
	var label = get_node_or_null("UI/LuckyMesajLabel")
	if panel and label:
		panel.visible = true
		label.text = "Kaçtın! Elmas kazandın!"

func lucky_havladi():
	print("Lucky havladı! Tüm düşmanlar yavaşlasın.")

	for child in find_children("*", "Node3D", true, false):
		if (child.name.begins_with("Ceteci") or child.name == "Bekci") and child.has_method("yavaslat"):
			print("-> Ceteci bulundu, yavaşlatılıyor.")
			child.yavaslat(3.0)
func dervis_mesaji_goster(mesaj: String) -> void:
	var panel = get_node_or_null("/root/World/HUD/UIRoot/UI/Control/DervisMesajPaneli")
	var label = panel.get_node_or_null("Label") if panel else null

	if panel and label:
		print(">>> Derviş mesajı gösteriliyor:", mesaj) # debug
		label.text = mesaj
		panel.visible = true
		await get_tree().create_timer(3.5).timeout
		panel.visible = false

func _ready() -> void:
	dervis_mesaji_goster("TEST MESAJI!")

	var panel = get_node_or_null("/root/World/HUD/UIRoot/UI/Control/DervisMesajPaneli")
	var label = panel.get_node_or_null("Label") if panel else null

	if panel and label:
		panel.visible = true
		label.text = "TEST GÖRÜNÜYOR MU?"
